class Solution(object):
    def beautifulSubstrings(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        def is_vowel(c):
            return c in "aeiou"

        count = 0
        for i in range(len(s)):
            vowels, consonants = 0, 0
            for j in range(i, len(s)):
                if is_vowel(s[j]):
                    vowels += 1
                else:
                    consonants += 1
                if vowels == consonants and (vowels * consonants) % k == 0:
                    count += 1
        return count
